def membership_makanan_high(n):
  if n > 8.5: return 1
  if n <= 6: return 0
  return (n - 6) / (8.5 - 6)

def membership_makanan_mid(n):
  if n > 8 or n <= 2: return 0
  if n > 2 and n <= 4.5: return (n - 2)/ (5 - 2)
  if n > 4.5 and n <= 6.5: return 1
  if n > 6.5 and n <= 8.5: return (8.5 - n) / (8.5 - 6.5)

def membership_makanan_low(n):
  if n <= 2: return 1
  if n > 4.5: return 0
  return (4.5 - n) / (4.5 - 2)

